import React, {useState, useEffect} from 'react'
import './App.css';


function App() {

    const [data, setData] = useState([{}])

    useEffect( () => {
        fetch("/users").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
  return(
      <div>
                {
                    console.log(data.users)
                    (typeof data.users === 'undefined') ? (<p>Loading...</p>):

                    <p> {data.users[0][0]}</p>
                }
      </div>
  )
}

export default App
